completion:
He was succeeded by his brother, Robert Linton of Sundrum and Stevithall (d.s.p. 1709), who married Martha (d.s.p. 1759), daughter of Robert Fisher of southeast Scotland.
In 1732 he married Ralph Trendenham, brother of Rowland Trendenham of Whitrack.
Rowland Trendenham Linton and Ralph Trendenham Linton (d.9 February 1757) of Brompton, Buckinghamshire and Old Brompton, and Kensington, Middlesex (d.s.p. 1767) married Sarah Ingraull (d.4 May 1748), and had issue:
- 1) Rowland Trendenham Linton (c.1729-2 Aug 1773) who married Eleanor (d.25 January 1752), daughter of Bartholomew Stockenham and Frances Fenner, and had numerous issue, including Rowland Trendenham Linton, Rowland William Trendenham Linton (1762-2 Aug 1782), and John Stockenham Linton (1743-2 August 1791);
- 2) John Stockenham Linton, Rector of Petsbury and YOU Tempel, who married Elizabeth, daughter and co-heir of Sir Robert Bagnil of Warth (d.1746) the elder, and had a son, John Stockenham Linton (c.1747-6 March 1758);
- and, Athol, who married Lovd Wolston (d.1767).
The eldest son, Rowland Trendenham Linton (c.1729-2 August 1773), brother of Ralph Trendenham Linton, was, in 1748, the client with his brother Robert of William Yarde, Esq., of Harple Nook, Lancaster, Lancaster. Rowland Trendenham Linton of Brompton, Suff.; eldest son and heir of Rowland Trendenham Linton; subject; witnessed Est. In Act, 26th March, 1748, by his brother Robert Yarde, Esq., J.P., and Bridget Landerse, Lady of the staff.
Rowland Trendenham Linton inherited Sundrum after the death of his father in 1716. In 1727 he married Anne (d.1748), daughter of John Wilmot of Warth, and had issue:
- 1) Bartleomew Wilmot, of Pucknall, Warwickshire (d.s.p. 7 April 1787), who married Mary Ann (d.26 May 1834), daughter of Charles Surtees, M.P., and had issue;
- 2) Rowland Wilmot Linton, of London (d.23 October 1768) who married Rachael Anne (d.23 October 1768), daughter of John Adam Selwyn, Esq., and had issue, including Rowland Wilmot Linton (c.1744-12 July 1777), who married Mary Anne astley (d.1783), daughter of William Astley and had a son, Rowland W. Linton (1774-24 December 1841), who married Elizabeth, daughter of James de Penje, and had issue;
- and Rowland Linton of Blatherwycke, Huntingdonshire.
Rowland Wilmot Linton of Blatherwycke (1740-13 December 1815) who married Susanna, (d.8 March 1774), daughter of Alexander Davie of Hakefield in Yorkshire, Esq., by 1 Agnes, daughter of Sir Thomasigan Smith Colvil, by whom he had issue;
Rowland Wilmot Linton of Blatherwycke (1778-6 March 1852) who married Louisa, daughter of B. Clarkson Wadham of Kirby Hall, West Riding of Yorkshire, by Elizabeth, daughter of N. Baring, M.P., by whom he had issue;
Rowland Wilmot Linton of Blatherwycke (1802-27 July 1866), who married first, Sarah Maria (d.27 December 1857), daughter of John Croft Durnford, of Loudon-in-Craven, and had issue; dying at the Brandling Lodge Hotel, Edinburgh, leaving John Croft Durnford (1825-9 April 1879);
and second, Priscilla Maria, daughter of Dr W. H. Metcalfe Lytton (1810-1876), of Erddig, and had issue;
[above notes, 12.5 and 17.17 NICE]
Bathurst, Rt. Hon. Gen. Sir Henry Boynton Linton, A.C.M.G., of Barton Court, Paignton, Devon (1807-14 October 1871), eldest son of Rowland William Linton was a colonel in the army.
